import React from 'react';
import SvgIcon from './SvgIcon';
import { Link } from 'react-router-dom'
import '../css/header.css';

class Header extends React.Component {
  render() {
		return (
            <header>
                <Link to="/" className='logo'>
                    <SvgIcon id="main-logo-icon" className="main-logo" />
                </Link>

                <nav className='main-menu'>
                    <Link to="/">
                        <SvgIcon id="personal-icon" className="nav-icon" />
                        Личный кабинет
                    </Link>
                    <Link to="/reports">Отчетность</Link>
                    <Link to="/help">Помощь</Link>
                    <a href="/">Реестр показателей</a>
                    <Link to="/about">О портале</Link>
                </nav>

                <div className='portal-options'></div>
            </header>
		)
	}
}

export default Header;
